import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import CardMedia from '@material-ui/core/CardMedia';
import iphone from '../src/assets/iphone.jpg'

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
        paddingTop: 100,

    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'left',
        fontSize: 20,
        padding: 50,
        color: theme.palette.text.secondary,
    },
    ul: {
        marginBottom: 300000000,


    },
    media: {

        height: 15,
        paddingBottom: 400,
    },
    container: {
        display: "flex",
        alignItems: "stretch",
    },

}));

export default function FullWidthGrid() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid container spacing={3} elevation={10} style={{ padding: '1.5em' }}>

                <Grid item xs={12} sm={6} container direction='row' spacing={2} alignItems="stretch">
                    <Paper className={classes.paper} style={{ height: '100%', width: '80%' }}>
                        <ul className={classes.ul}>
                            <li>Fast</li>
                            <li>User Friendly</li>
                            <li>Clean design</li>
                            <li>Responsive</li>
                        </ul>

                    </Paper>
                </Grid>
                <Grid item xs={12} sm={6} container direction='row' spacing={2} alignItems="stretch">
                    <Paper className={classes.paper} style={{ height: '100%', width: '80%' }}>
                        <Card className={classes.root}>
                            <CardMedia
                                className={classes.media}
                                image={iphone}
                                title="iphone"
                            />
                        </Card>
                    </Paper>
                </Grid>

            </Grid>
        </div >
    );
}
